	add("gerasena", "{\"term\":\"gerasena\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From the Latin \u0027\u0027 (({{l) \u0027or\u0027 {{l|la|terra|Terra}}) {{l|la|Gerasenus|Gerasēna}}|Gerasene [Region \u0027or\u0027 Land]|lang\u003dla}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The of the\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1828\u0027\u0027, (translator), (author), \u0027History of the Hebrew Commonwealth\u0027, chapter xi, § 106, [http://books.google.co.uk/books?id\u003dnvEuAAAAYAAJ\u0026amp;pg\u003dPA325\u0026amp;dq\u003d%22Gerasena%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dt9EdU-eXC8-Thgfe34CwDQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Gerasena%22\u0026amp;f\u003dfalse page 325\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Alexander Janneus, having now subdued his enemies, was attacked by a quartan fever occasioned by excessive drinking, and of this disease he died, three years after, while engaged in the siege of Ragaba in \u0027\u0027Gerasena\", \"priority\":4}]}, \"synonyms\":{}}");

	add("gerasene", "{\"term\":\"gerasene\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From the \u0027gerasēnus\u0027 \u0027gergesēnus\u0027 from the Ancient greek (to 1453) \u0027γερασηνός\u0027 \u0027γεργεσηνός\u0027 from \u0027γέρασα\u0027 \u0027γέργεσα\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A or of\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"And when he was come to the other side into the country of the \u0027\u0027Gergesenes\u0027\u0027, there met him two possessed with devils, coming out of the tombs, exceeding fierce, so that no man might pass by that way\", \"priority\":2}]}, \"synonyms\":{}}");

	add("geratology", "{\"term\":\"geratology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the elderly and diseases and other matters associated with senility; gerontology and geriatrics\", \"priority\":1}]}, \"synonyms\":{}}");

