	add("gerbil", "{\"term\":\"gerbil\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\", \"French\", \"Latin\"], \"text\":\"French \u0027gerbille\u0027 from Latin \u0027gerbo\u0027 from Arabic \u0027يَرْبُوع|lang\u003dar\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of several species of small, jumping, murine rodents, of the genus . In their leaping powers they resemble the jerboa. They inhabit Africa, India, and Southern Europe\", \"priority\":1}]}, \"synonyms\":{}}");

	add("gerenuk", "{\"term\":\"gerenuk\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Somali\"], \"text\":\"From Somali Image:Lightmatter gerenuk.jpg|thumb|A gerenuk\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of long-necked gazelle, native to central and eastern Africa\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, \u0027Water Music\u0027, Penguin 2006, p. 139\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Unaccountably, he finds himself thinking of \u0027\u0027gerenuks\u0027\u0027 and gazelles\", \"priority\":3}]}, \"synonyms\":{}}");

	add("germanene", "{\"term\":\"germanene\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|germanium|ene|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An allotrope of germanium that has a hexagonal, planar structure analogous to graphen\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Friedhelm Bechstedt, Lars Matthes, Paola Gori and Olivia Pulci, \u0026quot;Infrared absorbance of silicene and \u0027\u0027germanene\u0027\u0027\u0026quot;, Appl. Phys. Lett. 100, 261906 (27 June 2012) [http://scitation.aip.org/content/aip/journal/apl/100/26/10.1063/1.4731626 p. 261906-1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Calculating the complex dielectric function for optical interband transitions we show that the two-dimensional crystals silicene and \u0027\u0027germanene\u0027\u0027 possess the same low-frequency absorbance as graphene\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Lars Matthes, Olivia Pulci and Friedhelm Bechstedt, \u0026quot;Massive Dirac quasiparticles in the optical absorbance of graphene, silicene, germanene, and tinene\u0026quot;, \u0027Journal of Physics: Condensed Matter\u0027 25\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"39 (4 September 2013) 395305 [http://iopscience.iop.org/0953-8984/25/39/395305/ p. 395305-1\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"We present first-principles studies of the optical absorbance of the group IV honeycomb crystals graphene, silicene, \u0027\u0027germanene\u0027\u0027, and tinene\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, M E Dávila, L Xian, S Cahangirov, A Rubio and G Le Lay, \u0026quot;Germanene: a novel two-dimensional germanium allotrope akin to graphene and silicene\u0026quot;, New J. Phys. 16 095002 (9 September 2014) [http://iopscience.iop.org/1367-2630/16/9/095002/article p. 095002-2\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"After the successful synthesis of silicene in 2012, which was followed by a surge of studies on elemental, novel two-dimensional (2D) materials beyond graphene, a daunting quest was to obtain \u0027\u0027germanene\u0027\u0027, the germanium-based analogue of graphene, already predicted to possibly exist in 2009\", \"priority\":8}]}, \"synonyms\":{}}");

